import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import StudentList from './components/StudentList';
import CourseList from './components/CourseList';
import AddStudent from './components/AddStudent';
import AddCourse from './components/AddCourse';
import DeleteStudent from './components/DeleteStudent';
import DeleteCourse from './components/DeleteCourse';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={StudentList} />
        <Stack.Screen name="Course List" component={CourseList} />
        <Stack.Screen name="Add Student" component={AddStudent} />
        <Stack.Screen name="Add Course" component={AddCourse} />
        <Stack.Screen name="Delete Student" component={DeleteStudent} />
        <Stack.Screen name="Delete Course" component={DeleteCourse} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
